const video = document.getElementById("myVideo");

video.addEventListener('play', (event) => {
  loadedTime = Date.now();
  console.log("Play event started")
  this.state.clipLoaded = loadedTime; 
  loaded = true; 
})

document.addEventListener('keydown', (event) => {
  if (event.code === "Space" && loaded) {
    const now = Date.now();
    const difference = now - loadedTime;
    console.log("Space pressed")
    this.state.clipDifference = difference; 
    this.state.clipStopped = now; 
    this.state.spacePressed = true; 
  }
})

let difference = this.state.clipDifference; 
let spacePressed = this.state.spacePressed; 

if (spacePressed){
  this.state.Da_timePassed = difference; 
  if (difference < 3000){
    this.state.Db_category = 'audible'
  }
  else{
    this.state.Db_category = 'barely audible'
  }
}
else{
  this.state.Da_timePassed = 'null'
  this.state.Db_category = 'inaudible'
}

if (this.state.Db_category == this.state.Ce_audible_category){
